// ==UserScript==
// @name         RedServer
// @namespace    http://tampermonkey.net/
// @version      0.1
// @description  RedServer background replacer
// @match        https://redserver.su/*
// @exclude      https://redserver.su/index.php?app=bimchatbox*
// @icon         https://www.google.com/s2/favicons?sz=64&domain=redserver.su
// @grant        none
// @run-at       document-start
// ==/UserScript==

function add_style(css) {
  const style = document.getElementById("GM_addStyleBy8626") || (function() {
    const style = document.createElement('style');
    style.type = 'text/css';
    style.id = "GM_addStyleBy8626";
    document.head.appendChild(style);
    return style;
  })();
  const sheet = style.sheet;
  sheet.insertRule(css, (sheet.rules || sheet.cssRules || []).length);
}

function remove_element(id) {
    var el = document.getElementById(id);
    if (el) {
        el.parentNode.removeChild(el);
    }
}

function hijack_timer() {
    var script = document.createElement('script');
    script.type = "text/javascript";
    script.innerHTML = "\
window.originalsetTimeout = window.setTimeout;\
window.setTimeout = function(func, delay) {\
var stack = (new Error()).stack.toString();\
if (stack.indexOf(\"baseController.windowVisibilityChange\") != -1) {\
return 0;\
}\
return window.originalsetTimeout(func, delay);\
};\
";
    document.getElementsByTagName('head')[0].appendChild(script);
}

function add_styles() {
    add_style("body { \
background-size: inherit !important; \
background-repeat: repeat !important; \
background-image: url(data:image/jpeg;base64,\
\
\); }");
}

function process_page() {
    remove_element("gradientCon");
    remove_element("gradient");
    remove_element("gradientOverlay");
    hijack_timer();
    add_styles();
}

new MutationObserver((_, observer) => {
    const _script = document.querySelector('script').innerHTML;
    if (_script.indexOf("randomBackgroundPosition") != -1) {
        observer.disconnect();
        process_page();
    }
}).observe(document.documentElement, { childList: true, subtree: true });
